



ALTER TABLE ramen_jour_non_travaille ADD COLUMN fk_id_unit bigint;
ALTER TABLE ramen_jour_non_travaille ADD CONSTRAINT fk_id_unit_fkey FOREIGN KEY (fk_id_unit) REFERENCES unittree_unit(id_unit);


CREATE OR REPLACE function update_jour_non_travaille() 
RETURNS integer AS $$
  DECLARE  
	r RECORD;
  BEGIN
  
    FOR r IN SELECT jnt.id_jour_non_travaille AS id_jour_non_travaille,
		jnt.jour_du_mois AS jour_du_mois,
		jnt.mois AS mois,
		jnt.jour_semaine AS jour_semaine,
		jnt.commentaire AS commentaire,
		ujnt.id_unit AS id_unit
		FROM ramen_jour_non_travaille AS jnt INNER JOIN ramen_unit_jour_non_travaille AS ujnt ON ujnt.id_jour_non_travaille = jnt.id_jour_non_travaille
    
    LOOP
      
      VALUES (
	(SELECT COALESCE(MAX(id_jour_non_travaille), 0) + 1  AS next_id FROM ramen_jour_non_travaille),
	 r.jour_du_mois, 
	 r.mois, 
	 r.jour_semaine, 
	 r.commentaire, r.id_unit);
    END LOOP;  
    RETURN 1;
END;
$$ LANGUAGE plpgsql;


SELECT update_jour_non_travaille() AS update;
DELETE FROM ramen_jour_non_travaille WHERE ramen_jour_non_travaille.id_jour_non_travaille IN (
SELECT jnt.id_jour_non_travaille FROM ramen_jour_non_travaille AS jnt INNER JOIN ramen_unit_jour_non_travaille AS ujnt ON ujnt.id_jour_non_travaille = jnt.id_jour_non_travaille);

